def calculate_consecutive_brightnights(temperature_data):
    """
    Calculate the number of consecutive brightnights in the given temperature data.
    """
    brightnights = 0
    for temperature in temperature_data:
        if temperature < 0:
            brightnights += 1
        else:
            brightnights += 2
    return brightnights
