def create_new_list(old_list):
    """Create a new list that contains only the elements that are not in the old list, but keep the same order.
    For example, if old_list = [1, 2, 3, 4, 5], then new_list = [6, 7, 8, 9, 10]"""
    new_list = []
    for i in old_list:
        for j in range(1, 11):
            if i % j == 0:
                new_list.append(i)
    return new_list
