def count_unique_elements_in_list(list_of_lists):
    """
    Write a function to count the number of unique elements in a list of lists.
    The function should return a dictionary with the count of each element in the list of lists.

    For example, if the input is [[1, 2, 3], [4, 5, 6], [7, 8, 9], [4, 5, 6, 7, 8, 9]], the output should be {1: 3, 2: 3, 3: 3, 4: 3, 5: 3, 6: 3, 7: 3, 8: 3, 9: 3}.
    """
    result = {}
    for element in list_of_lists:
        for element1, element2 in zip(element, element):
            if element1 not in result:
                result[element1] = 1
            else
                result[element1] += 1
    return result
